import React from 'react'
import './bill.css'
import { useSelector } from 'react-redux';
import { HelperUseDataFetch } from '../listing';

export default function Bill() {
    const count = useSelector((state) => state.changeNumber);
    const item = HelperUseDataFetch("items")
    const showItem = [];
    for(let i=0;i<item.length;i++)
    {
        showItem
    }
    for(let i=0;i<item.length;i++)
    {
        if(count.has(item[i].id))
        {
            let a = item[i].product_name;
            let b = count.get(item[i].id)
            showItem[a].push(b);
        }

    }

  return (
    <div className="bill">
            {
            showItem.map(
                (value,key)=>{return <li key = {key}>{value}</li>}
            )}

    </div>
  )
}
